import React from 'react';
import conor from 'caminho/para/sua/imagem/conor.jpg';
import '../Select.css'

export default function Person(props)  {

  const { imgSrc, name, subtitle } = props;

  return (
    <div>
      <img src={props.imgSrc} className="imgperson" alt="Conor Okus"/>
      <div>
        <p>{name}</p>
        <p>{subtitle}</p>
      </div>
    </div>
  );
};
